import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import TestGraph from './pages/TestGraph';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/test-graph" element={<TestGraph />} />
      </Routes>
    </Router>
  );
}

export default App;
